import React from "react";
import { Route, Routes } from 'react-router-dom';
import Post from '../post/PagePost'; 
import Read from '../post/PageLoad';


const CategorySection = () => {
  return (
    <div>
    <div className="Box2">
      
      
      <ul>

        <li><a href="/blog">컴퓨터네트워크</a></li>
        <li><a href="/blog">리눅스마스터</a></li>
        <li><a href="/blog">C언어</a></li>
        <li><a href="/blog">html + 포토샵</a></li>
      </ul>
    </div>
    
      <div>
      <h4>대학교 공부정리(B/1-1)</h4>
    <div>
      <ul>
      {markdownFiles.map((file, index) => (
        <Link
          key={index}
          to={`/blog/${file.name}`}
        ><li><a href="/blog">컴퓨터네트워크</a></li>
          <h3>{file.name}</h3>
          <p>{file.content}</p> 
        </Link> 
      ))}
      </ul>
    </div>
    </div> 
    </div>
  );
};

export default CategorySection;
